import React from 'react'
import '../styles/matchScene.css'
import MatchCard from './MatchCard'

export default function MatchScene({names}) {
  return (
    <div className='backdrop'>
      <MatchCard names={names} style={{color: "red"}}></MatchCard>
      <MatchCard names={names} style={{color: "#0d47b3"}}></MatchCard>
    </div>
  )
}
